import React from "react";
import Cincinnati from "../img/footer-img/Cincinnati_logo.jpg";
import CBell from "../img/footer-img/CincinnatiBell-logo.png";
import FifthThird from "../img/footer-img/fifth_third_bank.jpg";
import Macy from "../img/footer-img/Macy's logo.jpg";
import PandG from "../img/footer-img/P&G.png";
import UC from "../img/footer-img/uc.png";
import Kao from "..//img"

const Footer = () => (
    <div className="Footer">
       <div className="sponsors">
           <img alt='' src= { Cincinnati } /> <p> Cincinnati_logo </p>
           <img alt='' src= { CBell } /> <p> Cincinnati bell logo </p>
           <img alt='' src= { FifthThird } /> <p> Fifth third bank </p> 
           <img alt='' src= { Macy } /> <p> Macy </p> 
           <img alt='' src= { PandG } /> <p> P&G </p>
           <img alt='' src= { UC } /> <p> UC </p>

      
        </div>

    
       <div className="Creators">
        <p>Lauren Moore</p>
        <p>Mona Jira</p>
        <p>Marquis Jarman</p>
        <p>We devoted our times and hearts to create the content of our beloved city.
         Hope you guys find it is useful infomation when you travel in our hometown. Let us know</p>

            



        </div>
    </div>
  );
  


export default Footer;
